function Fieldset({ firstInput, secInput, thirdInput }) {
    return (
        <form>
            <fieldset>
                <legend></legend>
                <input type="radio">{firstInput}</input>
                <input type="radio">{secInput}</input>
                <input type="radio">{thirdInput}</input>
                <button type="submit"></button>
            </fieldset>
        </form>
    );
}

export default Fieldset;
